import React from 'react';
import './App.css';
import AppBar from '@material-ui/core/AppBar';

function TopBar() {
    return (
        <AppBar>
            <div>
                Ben Dunk
            </div>
            <div>
                Home
            </div>
        </AppBar>
    );
}

export default TopBar;
